(string) (len=2017) "COMMENT\t> \\brief \\b DCABS1\nCOMMENT\t*\nCOMMENT\t*  =========== DOCUMENTATION ===========\nCOMMENT\t*\nCOMMENT\t* Online html documentation available at\nCOMMENT\t*            http://www.netlib.org/lapack/explore-html/\nCOMMENT\t*\nCOMMENT\t*  Definition:\nCOMMENT\t*  ===========\nCOMMENT\t*\nCOMMENT\t*       DOUBLE PRECISION FUNCTION DCABS1(Z)\nCOMMENT\t*\nCOMMENT\t*       .. Scalar Arguments ..\nCOMMENT\t*       COMPLEX*16 Z\nCOMMENT\t*       ..\nCOMMENT\t*       ..\nCOMMENT\t*\nCOMMENT\t*\nCOMMENT\t*> \\par Purpose:\nCOMMENT\t*  =============\nCOMMENT\t*>\nCOMMENT\t*> \\verbatim\nCOMMENT\t*>\nCOMMENT\t*> DCABS1 computes |Re(.)| + |Im(.)| of a double complex number\nCOMMENT\t*> \\endverbatim\nCOMMENT\t*\nCOMMENT\t*  Arguments:\nCOMMENT\t*  ==========\nCOMMENT\t*\nCOMMENT\t*> \\param[in] Z\nCOMMENT\t*> \\verbatim\nCOMMENT\t*>          Z is COMPLEX*16\nCOMMENT\t*> \\endverbatim\nCOMMENT\t*\nCOMMENT\t*  Authors:\nCOMMENT\t*  ========\nCOMMENT\t*\nCOMMENT\t*> \\author Univ. of Tennessee\nCOMMENT\t*> \\author Univ. of California Berkeley\nCOMMENT\t*> \\author Univ. of Colorado Denver\nCOMMENT\t*> \\author NAG Ltd.\nCOMMENT\t*\nCOMMENT\t*> \\date November 2017\nCOMMENT\t*\nCOMMENT\t*> \\ingroup double_blas_level1\nCOMMENT\t*\nCOMMENT\t*  =====================================================================\nIDENT\tDOUBLE\nIDENT\tPRECISION\nIDENT\tFUNCTION\nIDENT\tDCABS1\n(\t(\nIDENT\tZ\n)\t)\nCOMMENT\t*\nCOMMENT\t*  -- Reference BLAS level1 routine (version 3.8.0) --\nCOMMENT\t*  -- Reference BLAS is a software package provided by Univ. of Tennessee,    --\nCOMMENT\t*  -- Univ. of California Berkeley, Univ. of Colorado Denver and NAG Ltd..--\nCOMMENT\t*     November 2017\nCOMMENT\t*\nCOMMENT\t*     .. Scalar Arguments ..\nIDENT\tCOMPLEX\n*\t*1\nIDENT\t6\nIDENT\tZ\nCOMMENT\t*     ..\nCOMMENT\t*     ..\nCOMMENT\t*  =====================================================================\nCOMMENT\t*\nCOMMENT\t*     .. Intrinsic Functions ..\nIDENT\tINTRINSIC\nIDENT\tABS\n,\t,\nIDENT\tDBLE\n,\t,\nIDENT\tDIMAG\nCOMMENT\t*\nIDENT\tDCABS1\n=\t=\nIDENT\tABS\n(\t(\nIDENT\tDBLE\n(\t(\nIDENT\tZ\n)\t)\n)\t)\n+\t+\nIDENT\tABS\n(\t(\nIDENT\tDIMAG\n(\t(\nIDENT\tZ\n)\t)\n)\t)\nIDENT\tRETURN\nIDENT\tEND\n"
